import {Card, ListGroup, Button, Col, Link} from "react-bootstrap";

const Restaurant = ({ data }) => {
  return (
    <>
      {!data
        ? "Not found"
        : data.map((item) => {
            return (
              <>
              <Col xs={12} md={3}>
                <Card style={{width:'18rem'}} key = {item.idMeal} className="dish-card">
                  <Card.Img
                    variant="top"
                    src={item.strMealThumb}
                  />
                  <Card.Body className="content-res">
                    <Card.Title  className="name-res">
                    <Link to={`/restaurant/${item.idMeal}`}>
                    {item.strMeal}
                    </Link>
                    </Card.Title>
                    <Card.Text className="address-res">{item.strArea}</Card.Text>
                  </Card.Body>
                  <ListGroup className="list-group-flush">
                    <ListGroup.Item className="comment">Comment 1</ListGroup.Item>
                    <ListGroup.Item className="comment">Comment 2</ListGroup.Item>
                    <ListGroup.Item className="comment">Comment 3</ListGroup.Item>
                  </ListGroup>
                  <Card.Body>
                    <Button variant="success" className="card-button">Comment</Button>
                    <Button variant="success" className="card-button-save" >Save</Button>
                  </Card.Body>
                </Card>
                </Col>
              </>
            );
          })}
    </>
  );
};

export default Restaurant;
